dot((1.2,-0.7));

dot((2.8,1.7));
label("$A$",(2.8,1.7),NW);

dot((2.34,1));
label("$B$",(2.34,1),NW);
label("$5x-8^\circ$",(2.34,1),SW);

dot((1.66,0));
label("$D$",(1.66,0),NW);
label("$143^\circ$",(1.66,0),SE);

[/asy] The final Answer is 9
 ### Proof
 The angle marked $143^\circ$ and angle $CBD$ are corresponding angles and therefore have equal measures. It follows that $143^\circ$ and $5x-8^\circ$ sum to 180 degrees.
